import React from "react";
import { connect } from "react-redux";



function Home (props) {
    return (
        <div></div>
    );
  }
  

  
  const mapStateToProps = (state) => ({
    currentSelectedProfile: state.profiles.currentSelectedProfile
  })

  export default connect(null, mapStateToProps)(Home);
